if mibBuilder.loadTexts: cwaChanIdentifier.setStatus('current')
if mibBuilder.loadTexts: cwaChanIdentifier.setDescription('This number represents a RESOURCE at the switch that has been assigned for this connection (identified by ifIndex, cwaChanVpi and cwaChanVci). An example of this resource could be the LCN/GLCN used by the switch. Another example could be a record number assigned for this connection in a database of records. When a connection gets deleted, this resource gets released into a free pool. When a new endpoint is added (different ifIndex, cwaChanVpi & cwaChanVci), the switch may re-assign this resource. Thus all connections in a switch would have an unique cwaChanIdentifier. Since the number of resources in the switch is a much lesser subset as compared to all possible combinations of ifIndex, vpi and vci, this number serves as a quick reference index between the switch and the NMS. This is especially useful during the configuration upload of connections from the switch to the NMS.')
